'''Dorgesh-Kaan market trading''' is an activity that can be played at the market of [[Dorgesh-Kaan]]. It revolves around selling "exotic" surface foods to [[Dorgeshuun]] [[gourmet]]s for a certain price, with some foods being more or less desired than others. If executed well, a significant amount of money may be earned this way. Completion of [[Death to the Dorgeshuun]] is required to access the market.

==Starting out==
Before being able to sell foods, you will need to get permission first. This is done by speaking to [[Lurgon]], owner of [[Dorgesh-Kaan General Supplies]] - he can be found wandering around the middle of the market. He will explain the basics of trading and inform you that you will need permission from the [[Dorgeshuun Council]] first, with a certain (random) councillor in charge of the marketplace. Find this councillor and ask for permission, which you are granted instantly. Return to Lurgon - you will now be able to sell food to the goblins. This permission is only valid on the [[Server|game world]] it was earned on. Attempting to start the minigame on another world will require permission to be earned on that world, removing your permission from the previous world.

